import { createSlice } from '@reduxjs/toolkit';

export const foodSlice = createSlice({
  name: 'foods',
  initialState: [],
  reducers:{
      update: (state, action) =>{
          console.log(action)
          console.log(action.type)
      },
      remove: (state) => ( state = {} )
  }
})

export const {update, remove} = foodSlice.actions;
export default foodSlice.reducer;
